import Box from '@mui/material/Box';

const DialogueBox = (props) => {

    const { dialogue } = props;

    // we simply display the dialogue
    return (
        <Box>
            <div key={dialogue.id}>{dialogue.text} from {dialogue.user}</div>
        </Box>
    );
}

export default DialogueBox;
